import React, { useState, useEffect } from "react";
// import "./Styles.css";

function Contact() {
  fetch(
    "https://rapidapi.p.rapidapi.com/geocode/json?latlng=40.714224%2C-73.96145&language=en",
    {
      method: "GET",
      headers: {
        "x-rapidapi-key": "bd538a0cbfmshd5d6b51c7ced8d9p1b1e48jsn623334bcb300",
        "x-rapidapi-host": "google-maps-geocoding.p.rapidapi.com",
      },
    }
  )
    .then((response) => {
      console.log(response);
    })
    .catch((err) => {
      console.error(err);
    });
  return (
    <div className="centered">
      <h2>Contact and Map</h2>
    </div>
  );
}

export default Contact;
